const App = () => (
  <div>
    <Router>
      <Navbar />
      <Switch>
        <Route exact path='/' component={Login} />
        <Route path='/announcements' component={Annoucements} />
        <Route path='/projects' component={Projects} />
      </Switch>
    </Router>
  </div>
)

export default App;
